import PropTypes from 'prop-types';
import React, { Component } from 'react';
import backImage from '../Assets/Image/headerbg.jpg';
import { ImageBackground } from '../Components/ImageBackground';


export default class Header extends Component {
    static propTypes = {       
        backgroundImg: PropTypes.string,
        backgroundColor: PropTypes.string,        
        color: PropTypes.string
    }

    static defaultProps = {
        backgroundImg:backImage,       
        backgroundColor: null,

        onSearchClick: () => {
            console.log( 'A propriedade onSearchClick não foi implementada' )
        },
        color: null
    }
    render () {

        const backgroundImg =this.props

        const Wrapper = {
            backgroundImage: backImage,
            // background: 'blue',
            width: '100%',
            height: '300px',
            paddingTop: "20px"
        }

        const h2 = {
            width: "100%",
            color: 'white',
            fontWeight: 'bold',
            textAlign: 'center'

        }


        const h5 = {
            width: "100%",
            color: '#ededed',
            fontSize: "12px",
            textAlign: "right",
            paddingRight: "3px"
        }

        return (
            <div style={ Wrapper } >
                <ImageBackground

                    width={ '100%' }
                    backgroundImage={ backgroundImg }
                    source={ backgroundImg }
                    backgroundColor={ '#ff0000' }
                    parallax={ 50 }
                    color={ '#FFF' }

                >


                    <h2 style={ h2 }>PANÓPTICO</h2>
                    <h5 style={ h5 }>Seja bem vindo, { this.props.name }</h5>

                </ImageBackground>

            </div>
        )
    }
}
